    TRDC2->MRC_INDEX[3].MRC_GLBAC[4] = 0;
    TRDC2->MRC_INDEX[3].MRC_GLBAC[5] = 0;
    TRDC2->MRC_INDEX[3].MRC_GLBAC[6] = 0;
    TRDC2->MRC_INDEX[3].MRC_GLBAC[7] = 0;
    

    
    /* Security level configuration of checker MRC_W4 to OCRAM2 */
    TRDC2->MRC_INDEX[4].MRC_GLBAC[0] = 0x00007777U;
    TRDC2->MRC_INDEX[4].MRC_GLBAC[1] = 0x00007777U;
    TRDC2->MRC_INDEX[4].MRC_GLBAC[2] = 0;
    TRDC2->MRC_INDEX[4].MRC_GLBAC[3] = 0;
    TRDC2->MRC_INDEX[4].MRC_GLBAC[4] = 0;
