    TRDC2->MRC_INDEX[4].MRC_GLBAC[7] = 0;
    

    
    /* Security level configuration of checker MRC_W5 to SEMC */
    TRDC2->MRC_INDEX[5].MRC_GLBAC[0] = 0x00007777U;
    TRDC2->MRC_INDEX[5].MRC_GLBAC[1] = 0x00007777U;
    TRDC2->MRC_INDEX[5].MRC_GLBAC[2] = 0;
    TRDC2->MRC_INDEX[5].MRC_GLBAC[3] = 0;
    TRDC2->MRC_INDEX[5].MRC_GLBAC[4] = 0;
