    TRDC2->MRC_INDEX[6].MRC_GLBAC[4] = 0;
    TRDC2->MRC_INDEX[6].MRC_GLBAC[5] = 0;
    TRDC2->MRC_INDEX[6].MRC_GLBAC[6] = 0;
    TRDC2->MRC_INDEX[6].MRC_GLBAC[7] = 0;
    

    
    /* Security level configuration of masters */
    TRDC2->MDA_DFMT0[0].MDA_W_DFMT0[0] = 0xC0000004U;
    TRDC2->MDA_DFMT0[0].MDA_W_DFMT0[1] = 0x00004000U;
    TRDC2->MDA_DFMT0[1].MDA_W_DFMT0[0] = 0xC0000004U;
    TRDC2->MDA_DFMT0[1].MDA_W_DFMT0[1] = 0x00004000U;
    TRDC2->MDA_DFMT0[1].MDA_W_DFMT0[2] = 0x00004000U;
    TRDC2->MDA_DFMT1[2].MDA_W_DFMT1[0] = 0xE00000A9U;
    TRDC2->MDA_DFMT1[3].MDA_W_DFMT1[0] = 0xE00000A8U;
    TRDC2->MDA_DFMT1[4].MDA_W_DFMT1[0] = 0xE0000067U;
    TRDC2->MDA_DFMT0[5].MDA_W_DFMT0[0] = 0xC000800AU;
    TRDC2->MDA_DFMT0[5].MDA_W_DFMT0[1] = 0x00004000U;
    TRDC2->MDA_DFMT0[5].MDA_W_DFMT0[2] = 0x00004000U;
    TRDC2->MDA_DFMT0[5].MDA_W_DFMT0[3] = 0x00004000U;
