    TRDC2->MDA_DFMT0[5].MDA_W_DFMT0[6] = 0x00004000U;
    

    
    /* Security level configuration of masters */
    TRDC3->MDA_DFMT1[0].MDA_W_DFMT1[0] = 0x20000040U;
