    TRDC3->MDA_DFMT1[4].MDA_W_DFMT1[0] = 0x20000040U;
    

    
    /* Global Options */
    RGPIO1->LOCK = 0;
    RGPIO2->LOCK = 0;
    RGPIO3->LOCK = 0;
    RGPIO4->LOCK = 0;
    RGPIO5->LOCK = 0;
    RGPIO6->LOCK = 0;
    TRDC1->TRDC_CR = (TRDC1->TRDC_CR & 0xFFFF3FFEU) | 0x0000C001U;
    TRDC2->TRDC_CR = (TRDC2->TRDC_CR & 0xFFFF3FFEU) | 0x0000C001U;
    TRDC3->TRDC_CR = (TRDC3->TRDC_CR & 0xFFFF3FFEU) | 0x00000001U;
    TRDC1->TRDC_IDAU_CR &= 0xFFFFE0FEU;
